import React, { Component } from "react";
import { Link } from "react-router-dom";

const createProjectButton = () => {
  return (
    <React.Fragment>
      <Link
        to="/addProject"
        href="ProjectForm.html"
        className="btn btn-lg btn-info"
      >
        Create a Project
      </Link>
    </React.Fragment>
  );
};
export default createProjectButton;
